import React from 'react';
import './Slide.scss';

const Silde = (props) => {


    return (
        <div className='slide'>
            <div className='slide__q'>
                {props.question}
            </div>
            <div className='slide__wrap'>
                <div>Fine</div>
                <div>Terrible</div>
            </div>
        </div>
    )
}

export default Silde;
